import { Link } from "react-router-dom";
import style from "./Landing.module.css"

const Landing = ()=>{
    return(
        <>
        <Link to='/home/1'>
        <button className={style.button}></button>
        </Link>
        <img src="../../Utils/01.png" alt="About" />
        </>
    )
}

export default Landing;
